class Cardimp extends Component {
 render(){
        return ( 
            <div className="container-fluid d-flex justify-content-center">
                <div className="row">
                    <div className="col-md-6">
                        <Card imageSrc={img1} title="Nature" text="Nature makes beautiful"/>
                    </div>

                </div>
                <div className="col-md-6">
                        <Card imageSrc={img1} title="Movies" text="Avengers last part"/>
                    </div>
            </div>
         );
    }
}

export default Cardimp;
